window.bookSummaryJSON = "<p>In the 8th and final installment of the Quint series, nothing is as it seems.</p> <p></p> <p>Virginia Tumbler, a grief-stricken wife, claims her husband was murdered over his unfinished manuscript. She says the killer stole a black, zippered sleeve that contained the final chapter.</p> <p></p> <p>Quint is highly skeptical, assuming the sleeve has just been misplaced.</p> <p></p> <p>But then, people who have read the manuscript start dying, and Quint has no choice but to take the case.</p> <p></p> <p>It's a decision he will quickly begin to regret.</p> <p></p> <p>The Final Chapter will leave you gasping until, well, until the final chapter.</p>"; 
